import * as ethers from "ethers";

export class MetamaskProvider {
    constructor() {
        this.icon = 'data:image/png;base64,'
        this.name = "MetaMask"
        this.version = '1.0.0'
        this.chains = []
        this.accounts = []
        this.features = {
            "standard:connect": {
                version: '1',
                connect: this.connect,
            },
            "standard:disconnect": {
                version: '1',
                disconnect: demo,
            },
            "standard:events": {
                version: '1',
                events: demo,
            },
            "standard:switchNetwork": {
                version: '1',
                switchNetwork: this.switchNetwork,
            },
            "sui:signAndExecuteTransactionBlock": {
                version: '1',
                signAndExecuteTransactionBlock: demo,
            },
        }
    }

    async connect() {
        console.log('connect1')
        const provider = new ethers.providers.Web3Provider(window.ethereum);
        console.log('connect2')
        const accounts = await provider.send("eth_requestAccounts", []);
        this.accounts = accounts;
        console.log(provider)
        console.log('connect')

        return {
            "accounts": accounts.map(i => {
                return {
                    "address": i
                }
            })
        }
    }

    async switchNetwork(network_id) {
       return window.ethereum.request({
            method: "wallet_switchEthereumChain",
            params: [{ chainId: `0x${Number(network_id).toString(16)}`}],
        })
    }
}


function demo() {
    console.log('demo')
}
